import './App.css';
import LOL from "./components/LOL";
import GooglePay from "./components/payment/google-pay";
import ApplePay from "./components/payment/apple-pay";
import GooglePayV1 from "./components/payment/google-pay-v1";

function App() {
      return (
            <div className="App">
                  {/*<LOL/>*/}

                  <hr/>
                  <hr/>
                  <hr/>
                  <hr/>

                  <GooglePay/>

                  <hr/>
                  <hr/>
                  <hr/>
                  <hr/>

                  <GooglePayV1/>
                  <hr/>
                  <hr/>
                  <hr/>
                  <hr/>
                  <ApplePay/>
            </div>
      );
}

export default App;
